import React from "react";
import "./Panels.css";

type PanelProps = {
    number: number,
    header: string,
    text: string,
    icon: string
  }

export const Panels: React.FC<PanelProps> = ({header, text, icon, number}:PanelProps) => {
    return (
        <div className="flex process-item">
              <img src={icon} alt="process icon" />
              <div className="flex process-info">
                <h3>{header}</h3>
                <p className="small">
                  {text}
                </p>
              </div>
            </div>

    );
};
